def rgb_to_hex(rgb):
    r = int((rgb[0]/255) * 31) 
    g = int((rgb[1]/255) * 63)
    b = int((rgb[2]/255) * 31)
    hex_value = (r << 11) | (g << 5) | b
    return '0x{:04X}'.format(hex_value)

def convert_rgb_list_to_hex(rgb_list):
    hex_list = [rgb_to_hex(rgb) for rgb in rgb_list]
    return hex_list

def write_hex_to_file(hex_list, filename):
    with open(filename, 'w') as file:
        for hex_value in hex_list:
            file.write(hex_value + ',')


